import { useForm } from 'react-hook-form';


function Search(props) {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  localStorage.setItem("searchresult", JSON.stringify([{"id": "qwe"}]));
  let searchResults = JSON.parse(localStorage.getItem("searchresult"));
  return (
    <table style={{'tableLayout': 'fixed', 'width': '100%', 'height': '100%'}}>
      <tbody>
        <tr style={{"height": "66%"}}>
          <td style={{"width": "30%"}}>
          <form onSubmit={handleSubmit(loginHandler)}>
              <div>
                  <label>File name</label>
                  <input {...register('username', { required: true })} />
                  {errors.username && <p>Username is required.</p>}
              </div>
              <div>
                  <label>Password</label>
                  <input {...register('password', { pattern: /.......*/ })} />
                  {errors.password && <p>Password must be at least 6 symbols long.</p>}
              </div>
              <button>Log In</button>
            </form>
          </td>
          <td style={{"width": "60%"}}>
            {searchResults.map(elem => (
              <div key={elem.id}>
                THESE ARE SEARCH RESULTS
              </div>
            ))}
          </td>
        </tr>
      </tbody>
    </table>
  );
}

export default Search;
